import React from 'react';
import { db } from '../services/Firebase.js';


class People extends React.Component {

    state = { 
        users: null
    };

    componentDidMount(){
        console.log('mounted');
        db.collection('users')
            .get()
            .then( snapshot => {
                const users = []
                snapshot.forEach(doc => {
                    const data = doc.data();
                    users.push(data);
                });
                //console.log(snapshot);
                this.setState({ users: users});
        })
        .catch( error => console.log(error));
    };

    render(){
        return (
            <div className="people">
                <p>List of people</p>
                <List className="list">
                    <ListItem>
                    <ListItemAvatar>
                        <Avatar>
                        <FitnessCenterIcon />
                        </Avatar>
                    </ListItemAvatar>
                    <ListItemText primary="Bankdrukken" secondary="8x 40kg - 8x 60kg - 7x 70kg" />
                    <ListItemSecondaryAction>
                        <IconButton edge="end" aria-label="edit">
                        <EditIcon style={iconStyles}/>
                        </IconButton>
                    </ListItemSecondaryAction>
                    </ListItem>
                    <ListItem>
                    <ListItemAvatar>
                        <Avatar>
                        <FitnessCenterIcon />
                        </Avatar>
                    </ListItemAvatar>
                    <ListItemText primary="Incline dumbell press" secondary="8x 24kg - 8x 26kg - 8x 28kg" />
                    <ListItemSecondaryAction>
                        <IconButton edge="end" aria-label="edit">
                        <EditIcon style={iconStyles}/>
                        </IconButton>
                    </ListItemSecondaryAction>
                    </ListItem>
                    <ListItem>
                    <ListItemAvatar>
                        <Avatar>
                        <FitnessCenterIcon />
                        </Avatar>
                    </ListItemAvatar>
                    <ListItemText primary="Cable flies" secondary="10x 14kg - 10x 18kg - 10x 23kg" />
                    <ListItemSecondaryAction>
                        <IconButton edge="end" aria-label="edit">
                        <EditIcon style={iconStyles}/>
                        </IconButton>
                    </ListItemSecondaryAction>
                    </ListItem>
                    <ListItem>
                    <ListItemAvatar>
                        <Avatar>
                        <FitnessCenterIcon />
                        </Avatar>
                    </ListItemAvatar>
                    <ListItemText primary="Chest press center grip" secondary="10x 32kg - 10x 45kg - 10x 50kg" />
                    <ListItemSecondaryAction>
                        <IconButton edge="end" aria-label="edit">
                        <EditIcon style={iconStyles}/>
                        </IconButton>
                    </ListItemSecondaryAction>
                    </ListItem>
                    <ListItem>
                    <ListItemAvatar>
                        <Avatar>
                        <FitnessCenterIcon />
                        </Avatar>
                    </ListItemAvatar>
                    <ListItemText primary="Fly machine" secondary="10x 64kg - 10x 68kg - 10x 73kg" />
                    <ListItemSecondaryAction>
                        <IconButton edge="end" aria-label="edit">
                        <EditIcon style={iconStyles} />
                        </IconButton>
                    </ListItemSecondaryAction>
                    </ListItem>
                </List>
                {
                    this.state.users && this.state.users.map( user => {
                        return (
                            <div>
                                <p>{user.username}</p>
                            </div>
                        )
                    })
                }
            </div>
        )
    };
}
export default People;
